import React, {memo} from 'react';
import styled from 'styled-components';

const SnsContainer = styled.div`
    background-color: #333333;
    width:100%;
    
`;

const Sns = memo(() => {
  return (
    <SnsContainer>
      <h1><a href='https://kimhs7858.tistory.com/' target='_blank'>티스토리 블로그 (https://kimhs7858.tistory.com/)</a></h1>
    </SnsContainer>
  );
});

export default Sns;
